import { vop } from "./vop.js";
const some = vop();
some.default((v) => {
  for (let i = v.length; i-- > 0; ) {
    if (v[i]) return true;
  }
  return false;
});
const some2 = some.add(2, (a) => a[0] || a[1]);
const some3 = some.add(3, (a) => a[0] || a[1] || a[2]);
const some4 = some.add(4, (a) => a[0] || a[1] || a[2] || a[3]);
export {
  some,
  some2,
  some3,
  some4
};
